    }
    .nav-tabs .nav-link.active {
        background-color: #F16C09;
    }
    .children {
        padding: 0.5em 1em;
        margin:100px 400px;
        color: #DDF3F0;
        background: #e4fcff;/*背景色*/
        border-top: solid 6px #4ABDAC;
        box-shadow: 0 3px 4px rgba(0, 0, 0, 0.32);/*影*/
    }

    .index-box {
        position: relative;
        padding: 0.5em 1em;
        border-top: solid 3px #4ABDAC;
    }
    .index-box .box-title {
        position: absolute;
        margin:0px 400px;
        display: inline-block;
        top: -27px;
        left: -3px;
        padding: 0 9px;
        height: 25px;
        line-height: 25px;
        font-size: 17px;
        background: #4ABDAC;
        color: #ffffff;
        font-weight: bold;
        border-radius: 5px 5px 0 0;
    }
    .index-box p {
        margin:10px 400px;
        padding: 0;
    }


  footer {
      color:#99c;
      font-size:12pt;
      text-align:right;
      border-bottom:1px solid #99c;
      margin:100px 400px;
      position: relative;
      bottom: 10px;
      right: 10px;
      left: 10px;
  }
  h1 {
      font-size:22pt;
      font-weight:bold;
      text-align:left;
      letter-spacing:0px;
      color:#77a;
      margin:-50px 0px 50px 0px;
  }
  p {
      margin:0px;
      color:#669;
      font-size:12pt;
  }
  hr {
      margin:25px 0px;
  }
  tr {
      margin:0px;
  }
  th {
      font-size:14pt;
      font-weight:plain;
      text-align:left;
      padding:0px 20px;
      margin:0px;
      border-botton:1px solid gray;
  }
`} </style>
